import React, { useState } from "react";

import Owner_paragraph from "../Owner_Slide/Owner_paragraph";
import Client_paragraph from "../Clinet_Slide/Client_paragraph";

export const Mini_Nevbar = (props) => {

    const [Current_paragraph, update_paragraph] = useState()

    return <React.Fragment>

        <p id="Mini_Nevbar_tab_section">
        <span>Client</span>&nbsp;/&nbsp;<span>Owner</span>
        </p>

        {Current_paragraph}


    </React.Fragment>

}
